window.onload = () => {
  document.querySelectorAll('[list="search-results"]')[0].focus();
}

for (const pokemon of Object.keys(SETDATA)) {
  const node = document.createElement('option');
  node.innerText = pokemon;
  document.getElementById('search-results').appendChild(node);
}

const input = document.querySelectorAll('[list="search-results"]')[0];
input.addEventListener('keyup', e => {
  if (e.key == 'Enter') {
    render(input.value);
    input.value = '';
    input.blur();
    input.focus();
  }
});

function clear() {
  const abilities = document.getElementById('abilities');
  while (abilities.children.length > 0) abilities.children[0].remove();
  const items = document.getElementById('items');
  while (items.children.length > 0) items.children[0].remove();
  const moves = document.getElementById('moves');
  while (moves.children.length > 0) moves.children[0].remove();
  const stats = document.getElementById('stats-container');
  while (stats.children.length > 0) stats.children[0].remove();
  const types = document.getElementById('type-container');
  while (types.children.length > 0) types.children[0].remove();
}

function render(pokemon) {
  clear()
  let target = SETDATA[pokemon];
  document.getElementById('pokemon-name').innerHTML = `<strong>${pokemon}</strong><br>\nlv. ${target.level}`;
  const avatar = `https://www.smogon.com/dex/media/sprites/bw/${pokemon.toLowerCase()}.gif`;
  document.getElementById('sprite').setAttribute('src', avatar);

  const stats = document.getElementById('stats-container');
  for (i = 0; i < 6; i++) {
    let p = document.createElement('p');
    switch (i) {
      case 0:
        p.innerText = 'HP:';
        break;
      case 1:
        p.innerText = 'ATK:';
        break;
      case 2:
        p.innerText = 'DEF:';
        break;
      case 3:
        p.innerText = 'SPA:';
        break;
      case 4:
        p.innerText = 'SPD:';
        break;
      case 5:
        p.innerText = 'SPE:';
        break;
    }
    let d = document.createElement('div');
    d.setAttribute('class', 'stat-bar');
    //d.innerHTML = '&nbsp;';
    d.appendChild(p);
    stats.appendChild(d);
    let br = document.createElement('br');
    stats.appendChild(br);
  }



  for (const ability of target.abilities) {
    let node = document.createElement('li');
    node.innerText = ability;
    abilities.appendChild(node);
  }
  for (const item of target.items) {
    let node = document.createElement('li');
    node.innerText = item;
    items.appendChild(node);
  }
  for (const move of target.moves) {
    let node = document.createElement('li');
    node.innerText = move;
    moves.appendChild(node);
  }
  fetch(`pokemon/${pokemon}`)
  .then(res => res.json())
  .then(data => {
    target = data.injectRpcs[1][1].pokemon.find(p => p.name == pokemon);
    const stats = [target.hp, target.atk, target.def, target.spa, target.spd, target.spe];
    for (i = 0; i < 6; i++) {
      document.getElementById('stats-container').children[i*2].children[0].innerText += ' '+stats[i].toString();
      if (stats[i] >= 100) {
        document.getElementById('stats-container').children[i*2].children[0].style.fontWeight = 'bold';
      }
      document.getElementById('stats-container').children[i*2].style.width = 20+100*stats[i]/255+'%';
      document.getElementById('stats-container').children[i*2].style.backgroundColor = colors[stats[i]];
    }
  });
}